BEGIN TRAN
SET NOCOUNT ON;

CREATE TABLE #ModMaintenanceHistory
( 
	AssetNumber VARCHAR(100),
	CbmMonitorId bigint,
	RepairDate DATETIME
)



--DELETE FROM PFTWO where WO_NO like 'PFTWMOD%' 

           ,[WO_NO]
           ,[WorkOrderId]
           ,[BranchPlant]
           ,[FixedAssetId]
           ,[AssetNumber]
           ,[ItemNum]
           ,[PFTConfigId]
           ,[Active]
           ,[CurPFTWOSeqId]
           ,[UserIdAdded]
           ,[Revision]
           ,[IsDynamic]
           ,[ReferenceDocs]
           ,[SerialNum]
           ,[IncidentNum]
           ,[JobNum]
           ,[Combo]
           ,[IsDebug]
           ,[IsRTV]
           ,[DateAdded]
           ,[PFTType]
           ,[FWSensorId]
           ,[SensorName]
           ,[NCRRequestId]
           ,[JDEWorkOrderNum]
           ,[AssetRepairTrackId]
           ,[UpdatedBy]
           ,[ReasonForChange])
SELECT 
           NEWID() PFTWOId
           ,'PFTW240131'+ CONVERT(VARCHAR(4), ROW_NUMBER() OVER(ORDER BY f.AssetNumber)) WO_NO -- TODO: Have to get logic added for building
           ,null WorkOrderId
           ,0 BranchPlant
           ,f.FixedAssetId
           ,f.AssetNumber
           ,f.InventoryItemNum
           ,pc.PFTConfigId
           ,0 Active
           ,NULL CurPFTWOSeqId
           ,0 UserIdAdded
           ,NULL Revision
           ,0 IsDynamic
           ,NULL ReferenceDocs
           ,f.SerialNum
           ,NULL IncidentNum
           ,NULL JobNum
           ,NULL Combo
           ,0 IsDebug
           ,0 IsRTV
           ,modcbm.[RepairDate] DateAdded
           , 3 PFTType
           ,NULL FWSensorId
           ,NULL SensorName
           ,NULL NCRRequestId
           ,NULL JDEWorkOrderNum
           ,NULL AssetRepairTrackId
           ,NULL UpdatedBy
           ,'Closed - Passed' ReasonForChange
		   --modcbm.CbmMonitorId
	FROM (SELECT child.SerialNum,
				child.InventoryItemNum,
				CbmMonitorId,
				child.TopLevelFixedAssetId,
				MAX(RepairDate) RepairDate
		FROM #ModMaintenanceHistory m
		JOIN FixedAssets child on m.AssetNumber = child.AssetNumber
		GROUP BY SerialNum, InventoryItemNum, CbmMonitorId, child.TopLevelFixedAssetId
	) modcbm 
	JOIN CBMMonitor c (NOLOCK) on c.CBMMonitorId = modcbm.CbmMonitorId
	JOIN FixedAssets f (NOLOCK) ON f.FixedAssetId = modcbm.TopLevelFixedAssetId
	JOIN PFTConfig pc (NOLOCK) ON c.ObjectNumber = pc.ObjectNumber and pc.IsObsolete = 0
	ORDER BY SerialNum

